import numpy as np
import copy
try:
    from pyscf import lib
    einsum = lib.einsum
except ImportError:
    einsum = np.einsum

def mp2_energy(cc, T1, T2, subspace_proj=None):
    ''' Calculate MP2 energy (this is the CC energy without the T1^2 contribution)

        subspace_proj: ndarray of size nocc x nocc. This is an optional projector to a lower-rank
            subspace, spanned by the *occupied* spin-orbitals. The energy expression will then
            be calculated with this projector included, to calculate local quantities over
            occupied subspaces.

        NOTE: nocc is occupied orbitals in spinorbitals (alpha then beta) '''
    
    if subspace_proj is not None:
        assert(subspace_proj.shape[0]==subspace_proj.shape[1])
        assert(np.allclose(subspace_proj,subspace_proj.T))
        T1_proj = einsum('ji,ai->aj',subspace_proj,T1)
        T2_proj = einsum('ik,abij->abkj',subspace_proj,T2)
        # Symmetrize
        T2_proj = (T2_proj + T2_proj.transpose(1,0,3,2)) / 2.
    else:
        # No subspace projector
        T1_proj = T1
        T2_proj = T2

    # doubles contrib
    E = 0.25*einsum('abij,ijab->', T2_proj, cc.I.oovv)
    # t1 contribution
    E += einsum('ai,ia->', T1_proj, cc.fock_mo.ov)

    return E

def ccsd_energy(cc, T1, T2, autogen=False, subspace_proj=None):
    ''' Calculate CCSD energy. 
        Equation generating script using the 'wick' program found in gen_eqns/ccsd_T.py

        subspace_proj: ndarray of size nocc x nocc. This is an optional projector to a lower-rank
            subspace, spanned by the *occupied* spin-orbitals. The energy expression will then
            be calculated with this projector included, to calculate local quantities over
            occupied subspaces. Note that this is done relatively crudely by just assuming only a single
            occupied sum is split up over the subspaces, but could be extended to other approaches.

        NOTE: nocc is occupied orbitals in spinorbitals (alpha then beta)
    '''

    if subspace_proj is not None:
        assert(subspace_proj.shape[0]==subspace_proj.shape[1])
        assert(np.allclose(subspace_proj,subspace_proj.T))
        T1_proj = einsum('ji,ai->aj',subspace_proj,T1)
        T2_proj = einsum('ik,abij->abkj',subspace_proj,T2)
        # Symmetrize
        T2_proj = (T2_proj + T2_proj.transpose(1,0,3,2)) / 2.
    else:
        # No subspace projector
        T1_proj = T1
        T2_proj = T2

    if autogen:
        E = 1.0*einsum('ia,ai->', cc.fock_mo.ov, T1_proj)
        E += 0.25*einsum('ijab,baji->', cc.I.oovv, T2_proj)
        E += -0.5*einsum('ijab,bi,aj->', cc.I.oovv, T1_proj, T1)
    else:
        # doubles contrib
        E = 0.25*einsum('abij,ijab->', T2_proj, cc.I.oovv)
        # t1 contribution
        E += einsum('ai,ia->', T1_proj, cc.fock_mo.ov)
        # t1**2 contribution
        E += 0.5*einsum('ai,bj,ijab->', T1_proj, T1, cc.I.oovv)

    return E

def one_rdm_ferm(cc, autogen=False, write=True, make_hermitian=True, subspace_proj=None, include_mf=True):
    ''' Calculate 1RDM
        subspace_proj: ndarray of size nocc x nocc. This is an optional projector to a lower-rank
            subspace, spanned by the *occupied* spin-orbitals. The energy expression will then
            be calculated with this projector included, to calculate local quantities over
            occupied subspaces. Note that this is done relatively crudely by just assuming only a single
            occupied sum is split up over the subspaces, but could be extended to other approaches.

        NOTE nocc is occupied orbitals in spinorbitals (alpha then beta) '''

    if write:
        print('Computing fermionic space 1RDM...')

    if cc.L1 is None:
        if write:
            print('No optimized lambda amplitudes found to compute density matrices.')
            print('Using L = T^+ approximation...')
        cc.init_lam()

    L1 = cc.L1
    L2 = cc.L2
    T1 = cc.T1
    T2 = cc.T2
    # Small optimization for the vo block in the non-autogen code.
    opt = True 
    
    if subspace_proj is not None:
        assert(subspace_proj.shape[0]==subspace_proj.shape[1])
        assert(np.allclose(subspace_proj,subspace_proj.T))
        T1_proj = einsum('ji,ai->aj',subspace_proj,T1)
        T2_proj = einsum('ik,abij->abkj',subspace_proj,T2)
        L1_proj = einsum('ji,ia->ja',subspace_proj,L1)
        L2_proj = einsum('ik,ijab->kjab',subspace_proj,L2)
        # Symmetrize
        T2_proj = (T2_proj + T2_proj.transpose(1,0,3,2)) / 2.
        L2_proj = (L2_proj + L2_proj.transpose(1,0,3,2)) / 2.
    else:
        # No subspace projector
        T1_proj = T1
        T2_proj = T2
        L1_proj = L1
        L2_proj = L2

    if autogen:
        # Only oo and vv block currently autogenerated
        dm1_oo = -1.0*einsum('ia,aj->ij', L1_proj, T1)
        dm1_oo += 0.5*einsum('ikab,bajk->ij', L2_proj, T2)

        dm1_vv = 1.0*einsum('ib,ai->ab', L1_proj, T1)
        dm1_vv += -0.5*einsum('ijcb,caji->ab', L2_proj, T2)

        dm1_ov = L1_proj.copy()

        dm1_vo = T1_proj.copy() 
        dm1_vo += -1.0*einsum('jb,baij->ai', L1_proj, T2)
        dm1_vo += -1.0*einsum('jb,aj,bi->ai', L1_proj, T1, T1)
        dm1_vo += 0.5*einsum('jkbc,ci,bakj->ai', L2_proj, T1, T2)
        dm1_vo += 0.5*einsum('jkbc,aj,cbik->ai', L2_proj, T1, T2)
        
    else:
        dm1_oo = -einsum('ja,ai->ji', L1_proj, T1)
        dm1_oo -= 0.5*einsum('kjca,caki->ji', L2_proj, T2)

        dm1_vv = einsum('ia,bi->ba', L1_proj, T1)
        dm1_vv += 0.5*einsum('kica,cbki->ba', L2_proj, T2)
        
        # This is taken from pyscf. May already be hermitian here.
        dm1_ov = L1_proj.copy()

        if opt:
            dm1_vo = T1_proj.copy()
            T2temp = T2 - einsum('bi,aj->baji', T1, T1)
            dm1_vo += einsum('jb,baji->ai', L1_proj, T2temp)

            Pac = 0.5*einsum('kjcb,abkj->ac', L2_proj, T2)
            dm1_vo -= einsum('ac,ci->ai', Pac, T1)

            Pik = 0.5*einsum('kjcb,cbij->ik', L2_proj, T2)
            dm1_vo -= einsum('ik,ak->ai', Pik, T1)
        else:
            dm1_vo = T1 + einsum('jb,baji->ai', L1_proj, T2)
            dm1_vo -= einsum('jb,bi,aj->ai', L1_proj, T1, T1)
            dm1_vo -= 0.5*einsum('kjcb,ci,abkj->ai', L2_proj, T1, T2)
            dm1_vo -= 0.5*einsum('kjcb,ak,cbij->ai', L2_proj, T1, T2)

    dm1 = np.zeros((cc.nso, cc.nso))
    if make_hermitian:
        # Hermitize everything
        dm1[:cc.no, :cc.no] = (dm1_oo + dm1_oo.T) / 2.
        dm1[:cc.no, cc.no:] = (dm1_ov + dm1_vo.T) / 2.
        dm1[cc.no:, :cc.no] = dm1[:cc.no, cc.no:].T
        dm1[cc.no:, cc.no:] = (dm1_vv + dm1_vv.T) / 2.
    else:
        dm1[:cc.no, :cc.no] = dm1_oo
        dm1[:cc.no, cc.no:] = dm1_ov # + dm1_vo.T) / 2.
        dm1[cc.no:, :cc.no] = dm1_vo #[:cc.no, cc.no:].T
        dm1[cc.no:, cc.no:] = dm1_vv

    # Add mean-field part
    if include_mf:
        if subspace_proj is not None:
            dm1[:cc.no, :cc.no] += subspace_proj 
        else:
            dm1[np.diag_indices(cc.no)] += 1.
    if write:
        print('Trace of 1RDM: {}. Number of electrons: {}'.format(np.trace(dm1), cc.no))

    return dm1

def two_rdm_ferm(cc, autogen=False, write=True, subspace_proj=None):
    ''' Return fermionic sector 2RDM in pyscf (chemist) form, i.e.
        dm2[p,q,r,s] = <p^\dagger r^\dagger s q>
        where p,q,r,s are spin-orbitals. p,q correspond to one particle and r,s
        correspond to another particle.  The contraction between ERIs (in
        Chemist's notation) and rdm2 is E = einsum('pqrs,pqrs', eri, rdm2).

        Note that default ordering of the basis is occ_a, occ_b, virt_a, virt_b, although
        this is a general GHF code.
        
        subspace_proj: ndarray of size nocc x nocc. This is an optional projector to a lower-rank
            subspace, spanned by the *occupied* spin-orbitals. The energy expression will then
            be calculated with this projector included, to calculate local quantities over
            occupied subspaces. Note that this is done relatively crudely by just assuming only a single
            occupied sum is split up over the subspaces, but could be extended to other approaches.

        NOTES:

        nocc is occupied orbitals in spinorbitals (alpha then beta)

        Equations are derived from wick as [i,j,k,l] = <i^+ j^+ k l> for each block.
        This is done *without* taking the connected part, meaning that no 1rdm contribution
        needs to be included later on, as is done with the non-autogen code (from cqcpy).
        These then subsequently have their first two indices transposed
        or a minus sign inserted (note antisymmetry), for agreement with cqcpy
        Finally, the 2RDM is transposed as dm2.transpose(2,0,3,1), for
        consistency with pyscf.
    '''

    if write:
        print('Computing fermionic space 2RDM...')

    if cc.L1 is None:
        if write:
            print('No optimized lambda amplitudes found to compute density matrices.')
            print('Using L = T^+ approximation...')
        cc.init_lam()

    L1 = cc.L1.copy()
    L2 = cc.L2.copy()
    T1 = cc.T1.copy()
    T2 = cc.T2.copy()

    delta = np.eye(cc.no)
    
    if subspace_proj is not None:
        assert(subspace_proj.shape[0]==subspace_proj.shape[1])
        assert(np.allclose(subspace_proj,subspace_proj.T))
        T1_proj = einsum('ji,ai->aj',subspace_proj,T1)
        T2_proj = einsum('ik,abij->abkj',subspace_proj,T2)
        L1_proj = einsum('ji,ia->ja',subspace_proj,L1)
        L2_proj = einsum('ik,ijab->kjab',subspace_proj,L2)
        occ_proj = subspace_proj.copy()
        # Symmetrize
        T2_proj = (T2_proj + T2_proj.transpose(1,0,3,2)) / 2.
        L2_proj = (L2_proj + L2_proj.transpose(1,0,3,2)) / 2.
    else:
        # No subspace projector
        T1_proj = T1
        T2_proj = T2
        L1_proj = L1
        L2_proj = L2
        occ_proj = delta

    if autogen:
        # oooo block
        #dm2_oooo = -0.5*einsum('klab,baji->ijkl', L2, T2)
        #dm2_oooo += 1.0*einsum('klab,bi,aj->ijkl', L2, T1, T1)
        #dm2_oooo = dm2_oooo.transpose(1,0,2,3)  # This agrees now

        # No get_connected (includes the 1RDM contribution):
        dm2_oooo = 1.0*einsum('il,jk->ijkl', occ_proj, delta)
        dm2_oooo += -1.0*einsum('jl,ik->ijkl', occ_proj, delta)
        dm2_oooo += -0.5*einsum('klab,baji->ijkl', L2_proj, T2)
        dm2_oooo += 1.0*einsum('ka,ai,jl->ijkl', L1_proj, T1, delta)
        dm2_oooo += -1.0*einsum('ka,aj,il->ijkl', L1_proj, T1, delta)
        dm2_oooo += -1.0*einsum('la,ai,jk->ijkl', L1_proj, T1, delta)
        dm2_oooo += 1.0*einsum('la,aj,ik->ijkl', L1_proj, T1, delta)
        dm2_oooo += 1.0*einsum('klab,bi,aj->ijkl', L2_proj, T1, T1)
        dm2_oooo += -0.5*einsum('kmab,baim,jl->ijkl', L2_proj, T2, delta)
        dm2_oooo += 0.5*einsum('kmab,bajm,il->ijkl', L2_proj, T2, delta)
        dm2_oooo += 0.5*einsum('lmab,baim,jk->ijkl', L2_proj, T2, delta)
        dm2_oooo += -0.5*einsum('lmab,bajm,ik->ijkl', L2_proj, T2, delta)
        # Transposed for agreement with cqcpy
        dm2_oooo = dm2_oooo.transpose(1,0,2,3)

        # vvvv block
        dm2_vvvv = -0.5*einsum('ijba,cdji->abcd', L2_proj, T2)
        dm2_vvvv += 1.0*einsum('ijba,ci,dj->abcd', L2_proj, T1, T1)
        dm2_vvvv = dm2_vvvv.transpose(1,0,2,3)  # This agrees now

        # vovv block
        #dm2_vovv = 1.0*einsum('ja,bcij->aibc', L1, T2)
        #dm2_vovv += 0.5*einsum('jkda,di,bckj->aibc', L2, T1, T2)
        #dm2_vovv += -1.0*einsum('jkda,bj,dcik->aibc', L2, T1, T2)
        #dm2_vovv += 1.0*einsum('jkda,cj,dbik->aibc', L2, T1, T2)
        #dm2_vovv += -1.0*einsum('jkda,bj,ck,di->aibc', L2, T1, T1, T1)
        # no get_connected
        dm2_vovv = 1.0*einsum('ja,bcij->aibc', L1_proj, T2)
        dm2_vovv += -1.0*einsum('ja,bj,ci->aibc', L1_proj, T1, T1)
        dm2_vovv += 1.0*einsum('ja,cj,bi->aibc', L1_proj, T1, T1)
        dm2_vovv += 0.5*einsum('jkda,di,bckj->aibc', L2_proj, T1, T2)
        dm2_vovv += -1.0*einsum('jkda,bj,dcik->aibc', L2_proj, T1, T2)
        dm2_vovv += -0.5*einsum('jkda,bi,dckj->aibc', L2_proj, T1, T2)
        dm2_vovv += 1.0*einsum('jkda,cj,dbik->aibc', L2_proj, T1, T2)
        dm2_vovv += 0.5*einsum('jkda,ci,dbkj->aibc', L2_proj, T1, T2)
        dm2_vovv += -1.0*einsum('jkda,bj,ck,di->aibc', L2_proj, T1, T1, T1)
        dm2_vovv = dm2_vovv.transpose(0,1,3,2)

        # vvvo block
        dm2_vvvo = -1.0*einsum('ijba,cj->abci', L2_proj, T1)
        dm2_vvvo = dm2_vvvo.transpose(1,0,2,3)  # This agrees now

        #ovoo block
        #dm2_ovoo = 1.0*einsum('jkba,bi->iajk', L2, T1)
        # no get_connected
        dm2_ovoo = 1.0*einsum('ja,ik->iajk', L1_proj, delta)
        dm2_ovoo += -1.0*einsum('ka,ij->iajk', L1_proj, delta)
        dm2_ovoo += 1.0*einsum('jkba,bi->iajk', L2_proj, T1)
        dm2_ovoo = dm2_ovoo.transpose(0,1,3,2)

        #oovo block
        #dm2_oovo = 1.0*einsum('kb,baji->ijak', L1, T2)
        #dm2_oovo += -1.0*einsum('klbc,ci,bajl->ijak', L2, T1, T2)
        #dm2_oovo += 1.0*einsum('klbc,cj,bail->ijak', L2, T1, T2)
        #dm2_oovo += 0.5*einsum('klbc,al,cbji->ijak', L2, T1, T2)
        #dm2_oovo += -1.0*einsum('klbc,al,ci,bj->ijak', L2, T1, T1, T1)
        # No get_connected
        dm2_oovo = -1.0*einsum('ai,jk->ijak', T1_proj, delta)
        dm2_oovo += 1.0*einsum('aj,ik->ijak', T1_proj, delta)
        dm2_oovo += 1.0*einsum('kb,baji->ijak', L1_proj, T2)
        dm2_oovo += -1.0*einsum('kb,bi,aj->ijak', L1_proj, T1, T1)
        dm2_oovo += 1.0*einsum('kb,bj,ai->ijak', L1_proj, T1, T1)
        dm2_oovo += 1.0*einsum('lb,bail,jk->ijak', L1_proj, T2, delta)
        dm2_oovo += -1.0*einsum('lb,bajl,ik->ijak', L1_proj, T2, delta)
        dm2_oovo += -1.0*einsum('klbc,ci,bajl->ijak', L2_proj, T1, T2)
        dm2_oovo += 1.0*einsum('klbc,cj,bail->ijak', L2_proj, T1, T2)
        dm2_oovo += 0.5*einsum('klbc,al,cbji->ijak', L2_proj, T1, T2)
        dm2_oovo += -0.5*einsum('klbc,ai,cbjl->ijak', L2_proj, T1, T2)
        dm2_oovo += 0.5*einsum('klbc,aj,cbil->ijak', L2_proj, T1, T2)
        dm2_oovo += 1.0*einsum('lb,al,bi,jk->ijak', L1_proj, T1, T1, delta)
        dm2_oovo += -1.0*einsum('lb,al,bj,ik->ijak', L1_proj, T1, T1, delta)
        dm2_oovo += -1.0*einsum('klbc,al,ci,bj->ijak', L2_proj, T1, T1, T1)
        dm2_oovo += -0.5*einsum('lmbc,ci,baml,jk->ijak', L2_proj, T1, T2, delta)
        dm2_oovo += 0.5*einsum('lmbc,cj,baml,ik->ijak', L2_proj, T1, T2, delta)
        dm2_oovo += -0.5*einsum('lmbc,al,cbim,jk->ijak', L2_proj, T1, T2, delta)
        dm2_oovo += 0.5*einsum('lmbc,al,cbjm,ik->ijak', L2_proj, T1, T2, delta)
        dm2_oovo = dm2_oovo.transpose(1,0,2,3)
        
        # oovv
        dm2_oovv = 1.0*einsum('abji->ijab', T2_proj)
        dm2_oovv += -1.0*einsum('ai,bj->ijab', T1_proj, T1)
        dm2_oovv += 1.0*einsum('bi,aj->ijab', T1_proj, T1)
        dm2_oovv += -1.0*einsum('kc,ci,abjk->ijab', L1_proj, T1, T2)
        dm2_oovv += 1.0*einsum('kc,cj,abik->ijab', L1_proj, T1, T2)
        dm2_oovv += -1.0*einsum('kc,ak,cbji->ijab', L1_proj, T1, T2)
        dm2_oovv += 1.0*einsum('kc,ai,cbjk->ijab', L1_proj, T1, T2)
        dm2_oovv += -1.0*einsum('kc,aj,cbik->ijab', L1_proj, T1, T2)
        dm2_oovv += 1.0*einsum('kc,bk,caji->ijab', L1_proj, T1, T2)
        dm2_oovv += -1.0*einsum('kc,bi,cajk->ijab', L1_proj, T1, T2)
        dm2_oovv += 1.0*einsum('kc,bj,caik->ijab', L1_proj, T1, T2)
        dm2_oovv += -0.5*einsum('klcd,dcik,abjl->ijab', L2_proj, T2, T2)
        dm2_oovv += 0.5*einsum('klcd,dcjk,abil->ijab', L2_proj, T2, T2)
        dm2_oovv += -0.5*einsum('klcd,dalk,cbji->ijab', L2_proj, T2, T2)
        dm2_oovv += 1.0*einsum('klcd,daik,cbjl->ijab', L2_proj, T2, T2)
        dm2_oovv += 0.5*einsum('klcd,dblk,caji->ijab', L2_proj, T2, T2)
        dm2_oovv += -1.0*einsum('klcd,dbik,cajl->ijab', L2_proj, T2, T2)
        dm2_oovv += 0.25*einsum('klcd,ablk,dcji->ijab', L2_proj, T2, T2)
        dm2_oovv += 1.0*einsum('kc,ak,ci,bj->ijab', L1_proj, T1, T1, T1)
        dm2_oovv += -1.0*einsum('kc,ak,cj,bi->ijab', L1_proj, T1, T1, T1)
        dm2_oovv += -1.0*einsum('kc,bk,ci,aj->ijab', L1_proj, T1, T1, T1)
        dm2_oovv += 1.0*einsum('kc,bk,cj,ai->ijab', L1_proj, T1, T1, T1)
        dm2_oovv += -0.5*einsum('klcd,di,cj,ablk->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += 0.5*einsum('klcd,di,aj,cblk->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += -0.5*einsum('klcd,di,bj,calk->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += -0.5*einsum('klcd,dj,ai,cblk->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += 0.5*einsum('klcd,dj,bi,calk->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += 1.0*einsum('klcd,ak,di,cbjl->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += -1.0*einsum('klcd,ak,dj,cbil->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += -0.5*einsum('klcd,ak,bl,dcji->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += 0.5*einsum('klcd,ak,bi,dcjl->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += -0.5*einsum('klcd,ak,bj,dcil->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += -1.0*einsum('klcd,bk,di,cajl->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += 1.0*einsum('klcd,bk,dj,cail->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += -0.5*einsum('klcd,bk,ai,dcjl->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += 0.5*einsum('klcd,bk,aj,dcil->ijab', L2_proj, T1, T1, T2)
        dm2_oovv += 1.0*einsum('klcd,ak,bl,di,cj->ijab', L2_proj, T1, T1, T1, T1)
        dm2_oovv = dm2_oovv.transpose(1,0,2,3)

        # vvoo
        dm2_vvoo = 1.0*einsum('ijba->abij', L2_proj)
        dm2_vvoo = dm2_vvoo.transpose(1,0,2,3)

        # vovo
        dm2_vovo = 1.0*einsum('ja,bi->aibj', L1_proj, T1)
        dm2_vovo += 1.0*einsum('jkca,cbik->aibj', L2_proj, T2)
        dm2_vovo += -1.0*einsum('ka,bk,ij->aibj', L1_proj, T1, delta)
        dm2_vovo += 1.0*einsum('jkca,bk,ci->aibj', L2_proj, T1, T1)
        dm2_vovo += 0.5*einsum('klca,cblk,ij->aibj', L2_proj, T2, delta)
        dm2_vovo *= -1. # Flip sign
    else:
        # Code from cqcpy
        tfac = 1.0
        # oooo block
        T2temp = T2 + einsum('ci,dj->cdij', T1, T1)
        T2temp -= einsum('di,cj->cdij', T1, T1)
        dm2_oooo = 0.5*einsum('klab,abij->klij', L2_proj, T2temp)

        # ovoo block
        T2temp = T2 + einsum('ci,dj->cdij', T1, T1)
        T2temp -= einsum('di,cj->cdij', T1, T1)
        dm2_ovoo = -einsum('kb,baij->kaij', L1_proj, T2temp)
        LTo = einsum('klcd,cdil->ki', L2_proj, T2)
        tmp = -0.5*einsum('ki,aj->kaij', LTo, T1)
        dm2_ovoo += tmp - tmp.transpose((0, 1, 3, 2))
        Lklid = einsum('klcd,ci->klid', L2_proj, T1)
        tmp = -einsum('klid,adjl->kaij', Lklid, T2)
        dm2_ovoo += tmp - tmp.transpose((0, 1, 3, 2))
        dm2_ovoo += 0.5*einsum('lkdb,dbji,al->kaij', L2_proj, T2temp, T1)

        # vvoo block
        dm2_vvoo = tfac*T2_proj.copy()
        dm2_vvoo += tfac*einsum('ai,bj->abij', T1_proj, T1)
        dm2_vvoo -= tfac*einsum('aj,bi->abij', T1_proj, T1)
        LTki = einsum('kc,ci->ki', L1_proj, T1)
        tmp = -einsum('ki,abkj->abij', LTki, T2)
        dm2_vvoo += tmp - tmp.transpose((0, 1, 3, 2))
        LTac = einsum('kc,ak->ac', L1_proj, T1)
        tmp = -einsum('ac,cbij->abij', LTac, T2)
        dm2_vvoo += tmp - tmp.transpose((1, 0, 2, 3))
        T2temp = T2 - einsum('bk,cj->bcjk', T1, T1)
        LTbj = einsum('kc,bcjk->bj', L1_proj, T2temp)
        dm2_vvoo += einsum('ai,bj->abij', LTbj, T1)
        dm2_vvoo -= einsum('aj,bi->abij', LTbj, T1)
        dm2_vvoo -= einsum('bi,aj->abij', LTbj, T1)
        dm2_vvoo += einsum('bj,ai->abij', LTbj, T1)
        LToo = einsum('klcd,cdij->klij', L2_proj, T2)
        dm2_vvoo += 0.25*einsum('klij,abkl->abij', LToo, T2)
        LTov = einsum('klcd,caki->lida', L2_proj, T2)
        tmp = 0.5*einsum('lida,bdjl->abij', LTov, T2)
        dm2_vvoo += tmp - tmp.transpose((0, 1, 3, 2))
        dm2_vvoo -= tmp.transpose((1, 0, 2, 3))
        dm2_vvoo += tmp.transpose((1, 0, 3, 2))
        T2temp = T2 + einsum('cj,ai->acij', T1, T1) - einsum('ci,aj->acij', T1, T1)
        Lcb = einsum('klcd,bdkl->cb', L2_proj, T2)
        tmp = -0.5*einsum('cb,acij->abij', Lcb, T2temp)
        dm2_vvoo += tmp - tmp.transpose((1, 0, 2, 3))
        Lkj = einsum('klcd,cdjl->kj', L2_proj, T2)
        tmp = -0.5*einsum('kj,abik->abij', Lkj, T2temp)
        dm2_vvoo += tmp - tmp.transpose((0, 1, 3, 2))
        T2temp = T2 + einsum('ci,dj->cdij', T1, T1)
        LToo = einsum('klcd,cdij->klij', L2_proj, T2temp)
        tmp = einsum('klij,ak->alij', LToo, T1)
        tmp = 0.25*einsum('alij,bl->abij', tmp, T1)
        dm2_vvoo += tmp - tmp.transpose((1, 0, 2, 3))
        Looov = einsum('klcd,ci->klid', L2_proj, T1)
        Loooo = einsum('klid,dj->klij', Looov, T1)
        Loooo -= Loooo.transpose((0, 1, 3, 2))
        dm2_vvoo += 0.25*einsum('klij,abkl->abij', Loooo, T2temp)
        Lalid = einsum('klcd,ak,ci->alid', L2_proj, T1, T1)
        tmp = einsum('alid,bdjl->abij', Lalid, T2)
        dm2_vvoo -= tmp
        dm2_vvoo += tmp.transpose((0, 1, 3, 2)) + tmp.transpose((1, 0, 2, 3))
        dm2_vvoo -= tmp.transpose((1, 0, 3, 2))

        # NOTE: oovv block missing from cqcpy - but it is just the L2 amplitudes
        dm2_oovv = 1.0*einsum('ijba->ijab', L2_proj)
        dm2_oovv = dm2_oovv.transpose(1,0,2,3)

        # vovo block
        dm2_vovo = -einsum('ja,bi->bjai', L1_proj, T1)
        T2temp = T2 + einsum('bk,ci->bcki', T1, T1)
        dm2_vovo -= einsum('kjac,bcki->bjai', L2_proj, T2temp)

        # vvvo block
        T2temp = T2 + einsum('ci,dj->cdij', T1, T1)
        T2temp -= einsum('di,cj->cdij', T1, T1)
        dm2_vvvo = einsum('ja,bcji->bcai', L1_proj, T2temp)
        LTba = einsum('jlad,bdjl->ba', L2_proj, T2)
        dm2_vvvo += 0.5*einsum('ba,ci->bcai', LTba, T1)
        dm2_vvvo -= 0.5*einsum('ca,bi->bcai', LTba, T1)
        LTtemp = einsum('jkad,cdik->jcai', L2_proj, T2)
        dm2_vvvo += einsum('jcai,bj->bcai', LTtemp, T1)
        dm2_vvvo -= einsum('jbai,cj->bcai', LTtemp, T1)
        dm2_vvvo -= 0.5*einsum('kjda,cbkj,di->bcai', L2_proj, T2temp, T1)

        # vvvv block
        T2temp = T2 + einsum('ci,dj->cdij', T1, T1)
        T2temp -= einsum('di,cj->cdij', T1, T1)
        dm2_vvvv = 0.5*einsum('ijab,cdij->cdab', L2_proj, T2temp)
    
        # oovo block
        dm2_oovo = -einsum('jkab,bi->jkai', L2_proj, T1)
    
        # vovv block
        dm2_vovv = einsum('jiab,cj->ciab', L2_proj, T1)
    
    # Now put the blocks together, symmetrizing where appropriate
    # NOTE: We are storing as occupied_a, occupied_b, virtual_a, virtual_b
    dm2 = np.zeros((cc.nso, cc.nso, cc.nso, cc.nso))

    # Antisymmetric wrt switching annihilation operators
    dm2_oooo = (dm2_oooo - dm2_oooo.transpose(0,1,3,2)) / 2.
    dm2_vvvv = (dm2_vvvv - dm2_vvvv.transpose(0,1,3,2)) / 2.
    dm2_vovv = (dm2_vovv - dm2_vovv.transpose(0,1,3,2)) / 2.
    dm2_ovoo = (dm2_ovoo - dm2_ovoo.transpose(0,1,3,2)) / 2.
    dm2_oovv = (dm2_oovv - dm2_oovv.transpose(0,1,3,2)) / 2.
    dm2_vvoo = (dm2_vvoo - dm2_vvoo.transpose(0,1,3,2)) / 2.

    # Antisymmetric wrt switching creation operators
    dm2_vvvo = (dm2_vvvo - dm2_vvvo.transpose(1,0,2,3)) / 2.
    dm2_oooo = (dm2_oooo - dm2_oooo.transpose(1,0,2,3)) / 2.
    dm2_oovo = (dm2_oovo - dm2_oovo.transpose(1,0,2,3)) / 2.
    dm2_oovv = (dm2_oovv - dm2_oovv.transpose(1,0,2,3)) / 2.
    dm2_vvoo = (dm2_vvoo - dm2_vvoo.transpose(1,0,2,3)) / 2.

    # Hermitian wrt inverting of operator order
    dm2[:cc.no, :cc.no, :cc.no, :cc.no] = (dm2_oooo + dm2_oooo.transpose(3,2,1,0)) / 2.
    dm2[cc.no:, cc.no:, cc.no:, cc.no:] = (dm2_vvvv + dm2_vvvv.transpose(3,2,1,0)) / 2.
    
    # ovvv/vovv/vvov/vvvo blocks (two contributions to make sure we have both hermitian parts)
    dm2[:cc.no, cc.no:, cc.no:, cc.no:] = (-dm2_vovv.transpose(1,0,2,3) + dm2_vvvo.transpose(3,2,1,0)) / 2.
    dm2[cc.no:, :cc.no, cc.no:, cc.no:] = (dm2_vovv - dm2_vvvo.transpose(2,3,1,0)) / 2.
    dm2[cc.no:, cc.no:, :cc.no, cc.no:] = (dm2_vovv.transpose(3,2,1,0) - dm2_vvvo.transpose(0,1,3,2)) / 2.
    dm2[cc.no:, cc.no:, cc.no:, :cc.no] = (-dm2_vovv.transpose(3,2,0,1) + dm2_vvvo) / 2.

    # vooo/ovoo/oovo/ooov blocks (two contributions to make sure we have both hermitian parts)
    dm2[cc.no:, :cc.no, :cc.no, :cc.no] = (-dm2_ovoo.transpose(1,0,2,3) - dm2_oovo.transpose(2,3,1,0)) / 2.
    dm2[:cc.no, cc.no:, :cc.no, :cc.no] = (dm2_ovoo + dm2_oovo.transpose(3,2,1,0)) / 2.
    dm2[:cc.no, :cc.no, cc.no:, :cc.no] = (dm2_ovoo.transpose(3,2,1,0) + dm2_oovo) / 2.
    dm2[:cc.no, :cc.no, :cc.no, cc.no:] = (-dm2_ovoo.transpose(3,2,0,1) - dm2_oovo.transpose(0,1,3,2)) / 2.

    # vvoo/oovv blocks
    dm2[cc.no:, cc.no:, :cc.no, :cc.no] = (dm2_vvoo + dm2_oovv.transpose(3,2,1,0)) / 2.
    dm2[:cc.no, :cc.no, cc.no:, cc.no:] = (dm2_oovv + dm2_vvoo.transpose(3,2,1,0)) / 2.

    # voov / ovvo
    dm2[cc.no:, :cc.no, :cc.no, cc.no:] = (-dm2_vovo.transpose(0,1,3,2) - dm2_vovo.transpose(2,3,1,0)) / 2.
    dm2[:cc.no, cc.no:, cc.no:, :cc.no] = (-dm2_vovo.transpose(1,0,2,3) - dm2_vovo.transpose(3,2,0,1)) / 2.

    # vovo / ovov blocks
    dm2[cc.no:, :cc.no, cc.no:, :cc.no] = (dm2_vovo + dm2_vovo.transpose(2,3,0,1)) / 2.
    dm2[:cc.no, cc.no:, :cc.no, cc.no:] = (dm2_vovo.transpose(3,2,1,0) + dm2_vovo.transpose(1,0,3,2)) / 2.
    
    if not autogen:
        # Add 1rdm contribution when one electron traced out
        # This is because the non-autogen code was only the connected contribution
        dm1 = one_rdm_ferm(cc, autogen=autogen, write=False, subspace_proj=subspace_proj, include_mf=False)

        for i in range(cc.no):
            dm2[i,:,:,i] -= dm1
            dm2[:,i,i,:] -= dm1
            dm2[:,i,:,i] += dm1
            dm2[i,:,i,:] += dm1

        #print('Trace of 1RDM: {}. Number of electrons: {}'.format(np.trace(dm1), cc.no))
        # Add mean-field part
        # Note that we do this symmetrically, so that if we are including an occupied
        # projector, it does not break permuational symmetries.
        dm2[:cc.no, :cc.no, :cc.no, :cc.no] += 0.5*einsum('ik,jl->ijkl', occ_proj, delta)
        dm2[:cc.no, :cc.no, :cc.no, :cc.no] += 0.5*einsum('ik,jl->ijkl', delta, occ_proj)
        dm2[:cc.no, :cc.no, :cc.no, :cc.no] -= 0.5*einsum('il,jk->ijkl', occ_proj, delta)
        dm2[:cc.no, :cc.no, :cc.no, :cc.no] -= 0.5*einsum('il,jk->ijkl', delta, occ_proj)
        
        # Note that all permutational symmetries should be maintained even if including occupied projector

    # Transpose for consistency with pyscf
    dm2 = dm2.transpose(2,0,3,1)
    return dm2

def one_rdm_bos(cc, write=True):
    ''' Calculate bosonic 1RDM: <b^+_i b_j> '''
    if write:
        print('No bosonic RDM for the CCSD model...')
    return np.zeros((cc.nbos, cc.nbos))

def dm_singbos(cc, write=True):
    ''' Calculate single boson RDMs as a tuple, (<b^+>, <b>) '''
    if write:
        print('No single boson RDMs for the CCSD model...')
    return (np.zeros((cc.nbos)), np.zeros((cc.nbos)))

def eb_coup_rdm(cc, write=True):
    ''' Calculate the e-b coupling RDMs: <b^+_I p^+ q> and <b_I p^+ q>.
        Returns as a tuple (Ipq, Ipq), where the first matrix corresponds
        to the bosonic creation, and the second to the annihilation
    '''
    if write:
        print('No bosonic RDM for the CCSD model...')
    return (np.zeros((cc.nbos, cc.nso, cc.nso)), np.zeros((cc.nbos, cc.nso, cc.nso)))

def dd_moms_eom(cc, order, include_ref_proj=False, hermit_gs_contrib=False, write=True, pertspace=None, subspace_proj=None):
    ''' Get arbitrary-order moments of the fermionic density-density spectral function.
        mom[p,q,r,s,order] = <c^+_p c_q (H-E)^(order) c^+_r c_s> - \delta_{n0} <c^+_p c_q c^+r c_s>
        Note that the moments from 0 up to order will be computed and returned.
        These moments should be identical to the equivalent EOM spectral moments if
        include_ref_proj=False.

        include_ref_proj will include in the projector the HF reference determinant in the space
            If this is included, then the contribution of the ground state to the zeroth order moment
            needs to be removed, and this can be done with either the hermitized 1RDMs, or the non-
            hermitized 1RDM. This is controlled by 'hermit_gs_contrib'. However, this has the advantage
            that the moments will be exact for 2-electron systems.

        pertspace=None. If given, this should be an array of [nocc+nvir,npert], and will ensure that the
            returned dd-moments are only the ones which span the product fermionic space 
            of these column vectors (where the space of these perturbations is expressed in the canonical
            occ + virt space). The returned dd_moms will be of size [npert, npert, npert, npert, order+1],
            rather then evaluating all possible density moments over the fermionic space, and given in the
            basis defined by these vectors.
        '''
    if write:
        print('Computing fermionic space dd spectral moments up to (and including) order {}'.format(order))
        if pertspace is not None:
            print('Computing dd moments over custom subspace of full fermionic space, of size {}'.format(pertspace.shape[1]))
    if cc.L1 is None:
        if write:
            print('No optimized lambda amplitudes found to compute density matrices.')
            print('Using L = T^+ approximation...')
        cc.init_lam()

    if subspace_proj is not None:
        print('Unclear how to do a subspace L-amplitude projection for EOM. To investigate and implement later')
        1./0
    L1 = cc.L1
    L2 = cc.L2
    T1 = cc.T1
    T2 = cc.T2
    nocc = T1.shape[1]
    nvir = T1.shape[0]
    ntot = nocc + nvir
    delta_v = np.eye(T1.shape[0]) # Virtual-virtual delta
    delta_o = np.eye(T1.shape[1]) # Occupied-occupied delta
    if pertspace is not None:
        npert = pertspace.shape[1]
        assert(npert <= ntot)
        assert(pertspace.shape[0] == ntot)
    else:
        # Computing dd response in the original (full) occupied and virtual space
        npert = ntot
    dd_moms = np.zeros((npert, npert, npert, npert, order+1))
    
    # Set up the projection of the ket state
    # Note that for these kets, the final two indices are the perturbation indices
    R0_0 = np.zeros((nvir, nocc, ntot, ntot))   # Projection onto singles space
    R0_1 = np.zeros((nvir, nvir, nocc, nocc, ntot, ntot))   # Projection onto doubles space
    if include_ref_proj:
        R0_ref = np.zeros((ntot, ntot)) # Projection onto reference space (if desired)

    # occ-occ contrib
    if include_ref_proj:
        R0_ref[:nocc,:nocc] = delta_o.copy()
    R0_0[:,:,:nocc,:nocc] += -1.0*einsum('aj,ik->aijk', T1, delta_o)
    R0_1[:,:,:,:,:nocc,:nocc] += -1.0*einsum('baki,jl->abijkl', T2, delta_o)
    R0_1[:,:,:,:,:nocc,:nocc] += 1.0*einsum('bakj,il->abijkl', T2, delta_o)
    # occ-virt contrib
    if include_ref_proj:
        R0_ref[:nocc, nocc:] = T1.copy().transpose(1,0)
    R0_0[:,:,:nocc,nocc:] += -T2.copy().transpose(0,3,2,1) # -1.0*einsum('abji->aijb', T2)
    R0_0[:,:,:nocc,nocc:] += -1.0*einsum('bi,aj->aijb', T1, T1)
    R0_1[:,:,:,:,:nocc,nocc:] += -1.0*einsum('ak,bcji->abijkc', T1, T2)
    R0_1[:,:,:,:,:nocc,nocc:] += 1.0*einsum('bk,acji->abijkc', T1, T2)
    R0_1[:,:,:,:,:nocc,nocc:] += 1.0*einsum('ci,bakj->abijkc', T1, T2)
    R0_1[:,:,:,:,:nocc,nocc:] += -1.0*einsum('cj,baki->abijkc', T1, T2)
    # virt-occ contrib
    R0_0[:,:,nocc:,:nocc] += 1.0*einsum('ij,ab->aibj', delta_o, delta_v)
    # virt-virt contrib
    R0_0[:,:,nocc:,nocc:] += einsum('ci,ab->aibc', T1, delta_v)
    R0_1[:,:,:,:,nocc:,nocc:] += -1.0*einsum('adji,bc->abijcd', T2, delta_v) 
    R0_1[:,:,:,:,nocc:,nocc:] += 1.0*einsum('bdji,ac->abijcd', T2, delta_v)

    if pertspace is not None:
        # If we are specifying a custom perturbation subspace, then these initial vectors need to be rotated
        # into this subspace.
        R0_0_pert = einsum('aixy,xp,yq->aipq', R0_0, pertspace, pertspace)
        R0_1_pert = einsum('abijxy,xp,yq->abijpq',R0_1, pertspace, pertspace)
        if include_ref_proj:
            R0_ref_pert = einsum('xy,xp,yq->pq', R0_ref, pertspace, pertspace)
            kets = [(R0_ref_pert, R0_0_pert, R0_1_pert)]
        else:
            # Only pass in the singles and doubles space to the projector, not the reference state
            # Including this state however doesn't seem to change the excitation energies?
            kets = [(R0_0_pert, R0_1_pert)]
    else:
        if include_ref_proj:
            kets = [(R0_ref, R0_0, R0_1)]
        else:
            # Currently, only pass in the singles and doubles space to the projector, not the reference state
            # Including this state however doesn't seem to change the excitation energies?
            kets = [(R0_0, R0_1)]

    for i in range(order):
        # Apply (H-E) sequentially to each ket. Final index of the R vectors will be considered the list of vectors to apply the operator to.
        kets.append(apply_hbar_dd(cc, kets[-1]))

    # Find the bra states (First indices are perturbation operators)
    E_bra_0 = np.zeros((ntot, ntot, nocc, nvir))    # Projection of bra states onto single excitations
    E_bra_1 = np.zeros((ntot, ntot, nocc, nocc, nvir, nvir)) # Projection of bra states onto doubles
    if include_ref_proj:
        E_bra_hf = np.zeros((ntot, ntot))   # Optionally, include projection onto reference space

    # occ-occ blocks
    if include_ref_proj:
        E_bra_hf[:nocc, :nocc] = delta_o.copy()
        E_bra_hf[:nocc, :nocc] += -1.0*einsum('ia,aj->ji', L1, T1)
        E_bra_hf[:nocc, :nocc] += 0.5*einsum('ijab,bakj->ki', L2, T2)
    E_bra_0[:nocc,:nocc,:,:] += -1.0*einsum('ia,jk->jika', L1, delta_o)
    E_bra_0[:nocc,:nocc,:,:] += 1.0*einsum('ia,jk->jkia', L1, delta_o)
    E_bra_0[:nocc,:nocc,:,:] += 1.0*einsum('ijab,bk->kija', L2, T1)
    E_bra_1[:nocc,:nocc,:,:,:,:] += -1.0*einsum('ijab,kl->kijlba', L2, delta_o)
    E_bra_1[:nocc,:nocc,:,:,:,:] += 1.0*einsum('ijab,kl->kiljba', L2, delta_o)
    E_bra_1[:nocc,:nocc,:,:,:,:] += 1.0*einsum('ijab,kl->kljiba', L2, delta_o)
    # occ-vir blocks
    if include_ref_proj:
        E_bra_hf[:nocc,nocc:] = T1.copy().transpose(1,0)
        E_bra_hf[:nocc,nocc:] += -1.0*einsum('ia,abji->jb', L1, T2)
        E_bra_hf[:nocc,nocc:] += -1.0*einsum('ia,bi,aj->jb', L1, T1, T1)
        E_bra_hf[:nocc,nocc:] += 0.5*einsum('ijab,bk,acji->kc', L2, T1, T2)
        E_bra_hf[:nocc,nocc:] += 0.5*einsum('ijab,ci,bakj->kc', L2, T1, T2)

    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('ij,ab->iajb', delta_o, delta_v)
    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('ia,bj->jbia', L1, T1)
    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('ijab,bcki->kcja', L2, T2)
    E_bra_0[:nocc,nocc:,:,:] += -1.0*einsum('ia,bi,jk->jbka', L1, T1, delta_o)
    E_bra_0[:nocc,nocc:,:,:] += -1.0*einsum('ia,aj,bc->jbic', L1, T1, delta_v)
    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('ijab,ci,bk->kcja', L2, T1, T1)
    E_bra_0[:nocc,nocc:,:,:] += -0.5*einsum('ijab,bcji,kl->kcla', L2, T2, delta_o)
    E_bra_0[:nocc,nocc:,:,:] += -0.5*einsum('ijab,baki,cd->kcjd', L2, T2, delta_v)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ijab,ck->kcjiba', L2, T1)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ia,bc,jk->jbikac', L1, delta_v, delta_o)
    E_bra_1[:nocc,nocc:,:,:,:,:] += -1.0*einsum('ia,jk,bc->jbikca', L1, delta_o, delta_v)
    E_bra_1[:nocc,nocc:,:,:,:,:] += -1.0*einsum('ia,bc,jk->jbkiac', L1, delta_v, delta_o)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ia,jk,bc->jbkica', L1, delta_o, delta_v)
    E_bra_1[:nocc,nocc:,:,:,:,:] += -1.0*einsum('ijab,ci,kl->kcjlba', L2, T1, delta_o)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ijab,ci,kl->kcljba', L2, T1, delta_o)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ijab,bk,cd->kcjiad', L2, T1, delta_v)
    E_bra_1[:nocc,nocc:,:,:,:,:] += -1.0*einsum('ijab,bk,cd->kcjida', L2, T1, delta_v)
    # vir-occ blocks
    if include_ref_proj:
        E_bra_hf[nocc:, :nocc] = L1.copy().transpose(1,0)
    E_bra_0[nocc:,:nocc,:,:] += -1.0*L2.copy().transpose(3,0,1,2) # -1.0*einsum('ijab->bija', L2)
    # vir-vir blocks
    if include_ref_proj:
        E_bra_hf[nocc:, nocc:] += 1.0*einsum('ia,bi->ab', L1, T1)
        E_bra_hf[nocc:, nocc:] += -0.5*einsum('ijab,acji->bc', L2, T2)
    E_bra_0[nocc:,nocc:,:,:] += 1.0*einsum('ia,bc->abic', L1, delta_v)
    E_bra_0[nocc:,nocc:,:,:] += -1.0*einsum('ijab,ci->bcja', L2, T1)
    E_bra_1[nocc:,nocc:,:,:,:,:] += -1.0*einsum('ijab,cd->bcjiad', L2, delta_v)
    E_bra_1[nocc:,nocc:,:,:,:,:] += 1.0*einsum('ijab,cd->bcjida', L2, delta_v)

    if pertspace is not None:
        # If we are specifying a custom perturbation subspace, then these bra perturbed states need to be rotated
        # into this subspace
        E_bra_0_pert = einsum('xyia,xp,yq->pqia', E_bra_0, pertspace, pertspace)
        E_bra_1_pert = einsum('xyijab,xp,yq->pqijab', E_bra_1, pertspace, pertspace)
        if include_ref_proj:
            E_bra_hf_pert = einsum('xy,xp,yq->pq', E_bra_hf, pertspace, pertspace)
    else:
        E_bra_0_pert = E_bra_0
        E_bra_1_pert = E_bra_1
        if include_ref_proj:
            E_bra_hf_pert = E_bra_hf

    # Now, dot product together every set of states in kets list with the bra states of E_bra
    for i in range(order+1):
        if include_ref_proj:
            # Include contributions from the reference projector
            # This will ensure that all moments are exact for 2e systems
            # There is still a contribution to the 2RDM from a triples projector for >2e systems, so this will not be exactly right (for ov bra blocks)
            dd_moms[:,:,:,:,i] += einsum('pq,rs->pqrs', E_bra_hf_pert, kets[i][0])
            # Singles
            dd_moms[:,:,:,:,i] += einsum('pqia,airs->pqrs', E_bra_0_pert, kets[i][1])
            # Doubles
            dd_moms[:,:,:,:,i] += 0.25*einsum('pqijab,abijrs->pqrs', E_bra_1_pert, kets[i][2]) # Perhaps ab want to be swapped in one of these tensors, and maybe the factor wants to be a quarter?
        else:
            # No reference projector term
            dd_moms[:,:,:,:,i] += einsum('pqia,airs->pqrs', E_bra_0_pert, kets[i][0])
            dd_moms[:,:,:,:,i] += 0.25*einsum('pqijab,abijrs->pqrs', E_bra_1_pert, kets[i][1]) # Perhaps ab want to be swapped in one of these tensors, and maybe the factor wants to be a quarter?

    if include_ref_proj:
        # If we are including the reference state in the projector for the excitations definition, then
        # we need to remove the ground state contribution. We can approximate this as the product of 1RDMs
        # This can be done either as the product of hermitian, or non-hermitian RDMs (and hermitised after),
        # which is slightly different.
        # TODO: Do we need to think about the appropriate way to rigorously remove the GS contribution from higher-order moments?
        rdm1 = one_rdm_ferm(cc, write=False, make_hermitian=hermit_gs_contrib)
        if pertspace is not None:
            # Rotate RDM into perturbation space
            rdm_pert = einsum('xy,xp,yq->pq', rdm1, pertspace, pertspace)
        else:
            rdm_pert = rdm1
        dd_moms[:,:,:,:,0] -= einsum('pq,rs->pqrs',rdm_pert,rdm_pert) 

    # Hermitize all moments
    for i in range(order+1):
        dd_moms[:,:,:,:,i] = 0.5*(dd_moms[:,:,:,:,i] + dd_moms[:,:,:,:,i].transpose(3,2,1,0))

    return dd_moms

def apply_hbar_dd(cc, R):
    ''' Apply the N-electron effective hamiltonian in the space of 1h1p+2h2p to a trial state.
    R is a tuple of 1h1p and 2h2p2 states, with the final index being an index of the vectors
    to apply the state to'''

    if len(R) == 2:
        # Assume that we have the projection just onto a singles and doubles space
        R1 = R[0]
        R2 = R[1]
        include_ref_proj = False
    elif len(R) == 3:
        # Assume that we also have the projection onto a reference state
        R0 = R[0]
        R1 = R[1]
        R2 = R[2]
        assert(R0.shape[-1] == R2.shape[-1])
        include_ref_proj = True
    assert(R1.shape[-1] == R2.shape[-1])
    
    L1 = cc.L1
    L2 = cc.L2
    T1 = cc.T1
    T2 = cc.T2
    F = cc.fock_mo
    I = cc.I

    if include_ref_proj:
        # Include the projection onto the reference state
        S_ref = 1.0*einsum('ia,aipq->pq', F.ov, R1)
        S_ref += 0.25*einsum('ijab,bajipq->pq', I.oovv, R2)
        S_ref += -1.0*einsum('ijab,bi,ajpq->pq', I.oovv, T1, R1)
    
    S_0 = -1.0*einsum('ji,ajpq->aipq', F.oo, R1)
    S_0 += 1.0*einsum('ab,bipq->aipq', F.vv, R1)
    S_0 += -1.0*einsum('jb,abjipq->aipq', F.ov, R2)
    S_0 += -1.0*einsum('jaib,bjpq->aipq', I.ovov, R1)
    S_0 += 0.5*einsum('jkib,abkjpq->aipq', I.ooov, R2)
    S_0 += -0.5*einsum('jabc,cbjipq->aipq', I.ovvv, R2)
    S_0 += -1.0*einsum('jb,aj,bipq->aipq', F.ov, T1, R1)
    S_0 += -1.0*einsum('jb,bi,ajpq->aipq', F.ov, T1, R1)
    S_0 += -1.0*einsum('jkib,aj,bkpq->aipq', I.ooov, T1, R1)
    S_0 += 1.0*einsum('jkib,bj,akpq->aipq', I.ooov, T1, R1)
    S_0 += 1.0*einsum('jabc,ci,bjpq->aipq', I.ovvv, T1, R1)
    S_0 += -1.0*einsum('jabc,cj,bipq->aipq', I.ovvv, T1, R1)
    S_0 += -0.5*einsum('jkbc,aj,cbkipq->aipq', I.oovv, T1, R2)
    S_0 += -0.5*einsum('jkbc,ci,abkjpq->aipq', I.oovv, T1, R2)
    S_0 += 1.0*einsum('jkbc,cj,abkipq->aipq', I.oovv, T1, R2)
    S_0 += 1.0*einsum('jkbc,acji,bkpq->aipq', I.oovv, T2, R1)
    S_0 += 0.5*einsum('jkbc,ackj,bipq->aipq', I.oovv, T2, R1)
    S_0 += 0.5*einsum('jkbc,cbji,akpq->aipq', I.oovv, T2, R1)
    S_0 += -1.0*einsum('jkbc,aj,ck,bipq->aipq', I.oovv, T1, T1, R1)
    S_0 += 1.0*einsum('jkbc,ci,aj,bkpq->aipq', I.oovv, T1, T1, R1)
    S_0 += -1.0*einsum('jkbc,ci,bj,akpq->aipq', I.oovv, T1, T1, R1)

    S_1 = 1.0*einsum('ai,bjpq->abijpq', F.vo, R1)
    S_1 += -1.0*einsum('aj,bipq->abijpq', F.vo, R1)
    S_1 += -1.0*einsum('bi,ajpq->abijpq', F.vo, R1)
    S_1 += 1.0*einsum('bj,aipq->abijpq', F.vo, R1)
    S_1 += 1.0*einsum('ki,bakjpq->abijpq', F.oo, R2)
    S_1 += -1.0*einsum('kj,bakipq->abijpq', F.oo, R2)
    S_1 += 1.0*einsum('ac,bcjipq->abijpq', F.vv, R2)
    S_1 += -1.0*einsum('bc,acjipq->abijpq', F.vv, R2)
    S_1 += -1.0*einsum('kaji,bkpq->abijpq', I.ovoo, R1)
    S_1 += 1.0*einsum('kbji,akpq->abijpq', I.ovoo, R1)
    S_1 += -1.0*einsum('baic,cjpq->abijpq', I.vvov, R1)
    S_1 += 1.0*einsum('bajc,cipq->abijpq', I.vvov, R1)
    S_1 += -0.5*einsum('klji,balkpq->abijpq', I.oooo, R2)
    S_1 += 1.0*einsum('kaic,bckjpq->abijpq', I.ovov, R2)
    S_1 += -1.0*einsum('kajc,bckipq->abijpq', I.ovov, R2)
    S_1 += -1.0*einsum('kbic,ackjpq->abijpq', I.ovov, R2)
    S_1 += 1.0*einsum('kbjc,ackipq->abijpq', I.ovov, R2)
    S_1 += -0.5*einsum('bacd,dcjipq->abijpq', I.vvvv, R2)
    S_1 += -1.0*einsum('ki,ak,bjpq->abijpq', F.oo, T1, R1)
    S_1 += 1.0*einsum('ki,bk,ajpq->abijpq', F.oo, T1, R1)
    S_1 += 1.0*einsum('kj,ak,bipq->abijpq', F.oo, T1, R1)
    S_1 += -1.0*einsum('kj,bk,aipq->abijpq', F.oo, T1, R1)
    S_1 += 1.0*einsum('ac,ci,bjpq->abijpq', F.vv, T1, R1)
    S_1 += -1.0*einsum('ac,cj,bipq->abijpq', F.vv, T1, R1)
    S_1 += -1.0*einsum('bc,ci,ajpq->abijpq', F.vv, T1, R1)
    S_1 += 1.0*einsum('bc,cj,aipq->abijpq', F.vv, T1, R1)
    S_1 += -1.0*einsum('kc,ak,bcjipq->abijpq', F.ov, T1, R2)
    S_1 += 1.0*einsum('kc,bk,acjipq->abijpq', F.ov, T1, R2)
    S_1 += 1.0*einsum('kc,ci,bakjpq->abijpq', F.ov, T1, R2)
    S_1 += -1.0*einsum('kc,cj,bakipq->abijpq', F.ov, T1, R2)
    S_1 += 1.0*einsum('kc,acji,bkpq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('kc,acki,bjpq->abijpq', F.ov, T2, R1)
    S_1 += 1.0*einsum('kc,ackj,bipq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('kc,baki,cjpq->abijpq', F.ov, T2, R1)
    S_1 += 1.0*einsum('kc,bakj,cipq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('kc,bcji,akpq->abijpq', F.ov, T2, R1)
    S_1 += 1.0*einsum('kc,bcki,ajpq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('kc,bckj,aipq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('klji,ak,blpq->abijpq', I.oooo, T1, R1)
    S_1 += 1.0*einsum('klji,bk,alpq->abijpq', I.oooo, T1, R1)
    S_1 += 1.0*einsum('kaic,bk,cjpq->abijpq', I.ovov, T1, R1)
    S_1 += 1.0*einsum('kaic,cj,bkpq->abijpq', I.ovov, T1, R1)
    S_1 += -1.0*einsum('kaic,ck,bjpq->abijpq', I.ovov, T1, R1)
    S_1 += -1.0*einsum('kajc,bk,cipq->abijpq', I.ovov, T1, R1)
    S_1 += -1.0*einsum('kajc,ci,bkpq->abijpq', I.ovov, T1, R1)
    S_1 += 1.0*einsum('kajc,ck,bipq->abijpq', I.ovov, T1, R1)
    S_1 += -1.0*einsum('kbic,ak,cjpq->abijpq', I.ovov, T1, R1)
    S_1 += -1.0*einsum('kbic,cj,akpq->abijpq', I.ovov, T1, R1)
    S_1 += 1.0*einsum('kbic,ck,ajpq->abijpq', I.ovov, T1, R1)
    S_1 += 1.0*einsum('kbjc,ak,cipq->abijpq', I.ovov, T1, R1)
    S_1 += 1.0*einsum('kbjc,ci,akpq->abijpq', I.ovov, T1, R1)
    S_1 += -1.0*einsum('kbjc,ck,aipq->abijpq', I.ovov, T1, R1)
    S_1 += 1.0*einsum('bacd,di,cjpq->abijpq', I.vvvv, T1, R1)
    S_1 += -1.0*einsum('bacd,dj,cipq->abijpq', I.vvvv, T1, R1)
    S_1 += 1.0*einsum('klic,ak,bcljpq->abijpq', I.ooov, T1, R2)
    S_1 += -1.0*einsum('klic,bk,acljpq->abijpq', I.ooov, T1, R2)
    S_1 += 0.5*einsum('klic,cj,balkpq->abijpq', I.ooov, T1, R2)
    S_1 += -1.0*einsum('klic,ck,baljpq->abijpq', I.ooov, T1, R2)
    S_1 += 1.0*einsum('klic,ackj,blpq->abijpq', I.ooov, T2, R1)
    S_1 += 0.5*einsum('klic,aclk,bjpq->abijpq', I.ooov, T2, R1)
    S_1 += 1.0*einsum('klic,bakj,clpq->abijpq', I.ooov, T2, R1)
    S_1 += 0.5*einsum('klic,balk,cjpq->abijpq', I.ooov, T2, R1)
    S_1 += -1.0*einsum('klic,bckj,alpq->abijpq', I.ooov, T2, R1)
    S_1 += -0.5*einsum('klic,bclk,ajpq->abijpq', I.ooov, T2, R1)
    S_1 += -1.0*einsum('kljc,ak,bclipq->abijpq', I.ooov, T1, R2)
    S_1 += 1.0*einsum('kljc,bk,aclipq->abijpq', I.ooov, T1, R2)
    S_1 += -0.5*einsum('kljc,ci,balkpq->abijpq', I.ooov, T1, R2)
    S_1 += 1.0*einsum('kljc,ck,balipq->abijpq', I.ooov, T1, R2)
    S_1 += -1.0*einsum('kljc,acki,blpq->abijpq', I.ooov, T2, R1)
    S_1 += -0.5*einsum('kljc,aclk,bipq->abijpq', I.ooov, T2, R1)
    S_1 += -1.0*einsum('kljc,baki,clpq->abijpq', I.ooov, T2, R1)
    S_1 += -0.5*einsum('kljc,balk,cipq->abijpq', I.ooov, T2, R1)
    S_1 += 1.0*einsum('kljc,bcki,alpq->abijpq', I.ooov, T2, R1)
    S_1 += 0.5*einsum('kljc,bclk,aipq->abijpq', I.ooov, T2, R1)
    S_1 += 0.5*einsum('kacd,bk,dcjipq->abijpq', I.ovvv, T1, R2)
    S_1 += -1.0*einsum('kacd,di,bckjpq->abijpq', I.ovvv, T1, R2)
    S_1 += 1.0*einsum('kacd,dj,bckipq->abijpq', I.ovvv, T1, R2)
    S_1 += -1.0*einsum('kacd,dk,bcjipq->abijpq', I.ovvv, T1, R2)
    S_1 += 1.0*einsum('kacd,bdji,ckpq->abijpq', I.ovvv, T2, R1)
    S_1 += -1.0*einsum('kacd,bdki,cjpq->abijpq', I.ovvv, T2, R1)
    S_1 += 1.0*einsum('kacd,bdkj,cipq->abijpq', I.ovvv, T2, R1)
    S_1 += 0.5*einsum('kacd,dcji,bkpq->abijpq', I.ovvv, T2, R1)
    S_1 += -0.5*einsum('kacd,dcki,bjpq->abijpq', I.ovvv, T2, R1)
    S_1 += 0.5*einsum('kacd,dckj,bipq->abijpq', I.ovvv, T2, R1)
    S_1 += -0.5*einsum('kbcd,ak,dcjipq->abijpq', I.ovvv, T1, R2)
    S_1 += 1.0*einsum('kbcd,di,ackjpq->abijpq', I.ovvv, T1, R2)
    S_1 += -1.0*einsum('kbcd,dj,ackipq->abijpq', I.ovvv, T1, R2)
    S_1 += 1.0*einsum('kbcd,dk,acjipq->abijpq', I.ovvv, T1, R2)
    S_1 += -1.0*einsum('kbcd,adji,ckpq->abijpq', I.ovvv, T2, R1)
    S_1 += 1.0*einsum('kbcd,adki,cjpq->abijpq', I.ovvv, T2, R1)
    S_1 += -1.0*einsum('kbcd,adkj,cipq->abijpq', I.ovvv, T2, R1)
    S_1 += -0.5*einsum('kbcd,dcji,akpq->abijpq', I.ovvv, T2, R1)
    S_1 += 0.5*einsum('kbcd,dcki,ajpq->abijpq', I.ovvv, T2, R1)
    S_1 += -0.5*einsum('kbcd,dckj,aipq->abijpq', I.ovvv, T2, R1)
    S_1 += 0.5*einsum('klcd,adji,bclkpq->abijpq', I.oovv, T2, R2)
    S_1 += -1.0*einsum('klcd,adki,bcljpq->abijpq', I.oovv, T2, R2)
    S_1 += 1.0*einsum('klcd,adkj,bclipq->abijpq', I.oovv, T2, R2)
