    mom1_h_ov += -0.5*einsum('ijab,lmcd,di,ck,el,bamj->ke', L2, I.oovv, T1, T1, T1, T2)
    mom1_h_ov += -0.5*einsum('ijab,lmcd,di,cl,em,bakj->ke', L2, I.oovv, T1, T1, T1, T2)
