            Lag += 0.015625*einsum('ijab,kajc,cbki->', L2, I.ovov, T2)
            Lag += 0.015625*einsum('ijab,kaci,bcjk->', L2, I.ovvo, T2)
            Lag += -0.015625*einsum('ijab,kaci,bckj->', L2, I.ovvo, T2)
            Lag += -0.015625*einsum('ijab,kaci,cbjk->', L2, I.ovvo, T2)
            Lag += 0.015625*einsum('ijab,kaci,cbkj->', L2, I.ovvo, T2)
            Lag += -0.015625*einsum('ijab,kacj,bcik->', L2, I.ovvo, T2)
