            Lag += 0.015625*einsum('ijab,kacj,cbik->', L2, I.ovvo, T2)
            Lag += -0.015625*einsum('ijab,kacj,cbki->', L2, I.ovvo, T2)
            Lag += 0.015625*einsum('ijab,kbic,acjk->', L2, I.ovov, T2)
            Lag += -0.015625*einsum('ijab,kbic,ackj->', L2, I.ovov, T2)
            Lag += -0.015625*einsum('ijab,kbic,cajk->', L2, I.ovov, T2)
            Lag += 0.015625*einsum('ijab,kbic,cakj->', L2, I.ovov, T2)
            Lag += -0.015625*einsum('ijab,kbjc,acik->', L2, I.ovov, T2)
            Lag += 0.015625*einsum('ijab,kbjc,acki->', L2, I.ovov, T2)
            Lag += 0.015625*einsum('ijab,kbjc,caik->', L2, I.ovov, T2)
            Lag += -0.015625*einsum('ijab,kbjc,caki->', L2, I.ovov, T2)
            Lag += -0.015625*einsum('ijab,kbci,acjk->', L2, I.ovvo, T2)
            Lag += 0.015625*einsum('ijab,kbci,ackj->', L2, I.ovvo, T2)
            Lag += 0.015625*einsum('ijab,kbci,cajk->', L2, I.ovvo, T2)
            Lag += -0.015625*einsum('ijab,kbci,cakj->', L2, I.ovvo, T2)
            Lag += 0.015625*einsum('ijab,kbcj,acik->', L2, I.ovvo, T2)
            Lag += -0.015625*einsum('ijab,kbcj,acki->', L2, I.ovvo, T2)
            Lag += -0.015625*einsum('ijab,kbcj,caik->', L2, I.ovvo, T2)
            Lag += 0.015625*einsum('ijab,kbcj,caki->', L2, I.ovvo, T2)
            Lag += 0.015625*einsum('ijab,akic,bcjk->', L2, I.voov, T2)
            Lag += -0.015625*einsum('ijab,akic,bckj->', L2, I.voov, T2)
            Lag += -0.015625*einsum('ijab,akic,cbjk->', L2, I.voov, T2)
            Lag += 0.015625*einsum('ijab,akic,cbkj->', L2, I.voov, T2)
            Lag += -0.015625*einsum('ijab,akjc,bcik->', L2, I.voov, T2)
            Lag += 0.015625*einsum('ijab,akjc,bcki->', L2, I.voov, T2)
            Lag += 0.015625*einsum('ijab,akjc,cbik->', L2, I.voov, T2)
            Lag += -0.015625*einsum('ijab,akjc,cbki->', L2, I.voov, T2)
            Lag += -0.015625*einsum('ijab,akci,bcjk->', L2, I.vovo, T2)
            Lag += 0.015625*einsum('ijab,akci,bckj->', L2, I.vovo, T2)
            Lag += 0.015625*einsum('ijab,akci,cbjk->', L2, I.vovo, T2)
