            Lag += 0.015625*einsum('ijab,akcj,cbki->', L2, I.vovo, T2)
            # From separate grouping
            Lag += -0.015625*einsum('ijab,bkic,acjk->', L2, I.voov, T2)
            Lag += 0.015625*einsum('ijab,bkic,ackj->', L2, I.voov, T2)
