            Lag += -0.015625*einsum('ijab,bkic,cakj->', L2, I.voov, T2)
            Lag += 0.015625*einsum('ijab,bkjc,acik->', L2, I.voov, T2)
            Lag += -0.015625*einsum('ijab,bkjc,acki->', L2, I.voov, T2)
            Lag += -0.015625*einsum('ijab,bkjc,caik->', L2, I.voov, T2)
